aphy\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"em\",\"size\":2.7,\"sizes\":[]},\"typography_font_size_tablet\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"typography_font_size_mobile\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"typography_font_weight\":\"500\",\"typography_font_style\":\"normal\",\"typography_line_height\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"typography_word_spacing\":{\"unit\":\"px\",\"size\":5,\"sizes\":[]},\"_border_radius\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":true},\"_box_shadow_box_shadow\":{\"horizontal\":4,\"vertical\":0,\"blur\":10,\"spread\":0,\"color\":\"rgba(0,0,0,0.5)\"},\"__globals__\":{\"text_color\":\"\"}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"5480899\",\"elType\":\"widget\",\"settings\":{\"width\":{\"unit\":\"%\",\"size\":46,\"sizes\":[]},\"align\":\"left\",\"text\":\"Divider\",\"weight\":{\"unit\":\"px\",\"size\":3,\"sizes\":[]},\"gap\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"17b62f1\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"stretch_section\":\"section-stretched\",\"structure\":\"21\",\"margin\":{\"unit\":\"px\",\"top\":\"25\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":false}},\"elements\":[{\"id\":\"30a820a\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"eaf10cb\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"\\/wp-content\\/uploads\\/2022\\/04\\/salad.png\",\"id\":355,\"alt\":\"\",\"source\":\"library\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"90d9816\",\"elType\":\"column\",\"settings\":{\"_column_size\":66,\"_inline_size\":null},\"elements\":[{\"id\":\"e71632d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>1.Sunny location: Most veggies require 6 to 8 hours in direct sunlight each day. A few vegetables (mainly the leafy ones) can endure some shade.<\\/p>\\n<p>\\u00a0<\\/p>\\n<p>2.Drains effectively and does not remain wet: If your soil is poorly drained and water pools, grow vegetables in a raised bed or elevated row to improve drainage. Moist soil implies wet roots, which can decay over time. If your soil is rocky, till it and remove the rocks, since they will interfere with root growth and make your plants weaker.<\\/p>\\n<p>\\u00a0<\\/p>\\n<p>3.Stable and wind-free: Avoid locations with strong gusts that could knock over your young plants or prevent pollinators from doing their job. You also don\'t want to plant in an area that gets a lot of foot traffic or floods readily. Plant at a spot that would make Goldilocks happy\\u2014somewhere \\\"just right.\\\"<\\/p>\\n<p>\\u00a0<\\/p>\\n<p>4.Soil that is nutrient-dense. Your plants are fed by the earth. Poor, sickly plants will result from thin, nutrient-deficient soil. To help your plants grow, provide plenty of organic stuff. Learn how to prepare your soil for vegetable gardening.<\\/p>\",\"text_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18,\"sizes\":[]},\"typography_font_weight\":\"400\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"c004401\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"stretch_section\":\"section-stretched\",\"margin\":{\"unit\":\"px\",\"top\":\"26\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":false}},\"elements\":[{\"id\":\"c0a462f\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"776a54e\",\"elType\":\"widget\",\"settings\":{\"width\":{\"unit\":\"%\",\"size\":46,\"sizes\":[]},\"align\":\"right\",\"text\":\"Divider\",\"weight\":{\"unit\":\"px\",\"size\":3,\"sizes\":[]},\"gap\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"cf8c38f\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h2><strong>Where and When to Plant<\\/strong><\\/h2>\",\"align\":\"center\",\"text_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"em\",\"size\":2.7,\"sizes\":[]},\"typography_font_size_tablet\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"typography_font_size_mobile\":{\"unit\":\"em\",\"size\":\"\",\"sizes\":[]},\"typography_font_weight\":\"500\",\"typography_font_style\":\"normal\",\"typography_line_height\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"typography_word_spacing\":{\"unit\":\"px\",\"size\":5,\"sizes\":[]},\"_border_radius\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":true},\"_box_shadow_box_shadow\":{\"horizontal\":4,\"vertical\":0,\"blur\":10,\"spread\":0,\"color\":\"rgba(0,0,0,0.5)\"},\"__globals__\":{\"text_color\":\"\"}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"5df0c3c\",\"elType\":\"widget\",\"settings\":{\"width\":{\"unit\":\"%\",\"size\":46,\"sizes\":[]},\"align\":\"left\",\"text\":\"Divider\",\"weight\":{\"unit\":\"px\",\"size\":3,\"sizes\":[]},\"gap\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"6d408cc\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"stretch_section\":\"section-stretched\",\"structure\":\"21\",\"margin\":{\"unit\":\"px\",\"top\":\"25\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":false}},\"elements\":[{\"id\":\"4ab3ed7\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"e1ab838\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"\\/wp-content\\/uploads\\/2022\\/04\\/small-plant.png\",\"id\":362,\"alt\":\"\",\"source\":\"library\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"ef3a5a8\",\"elType\":\"column\",\"settings\":{\"_column_size\":66,\"_inline_size\":null},\"elements\":[{\"id\":\"6abbd8c\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>1.Vegetables are not all planted at the same time. \\\"Cool-season\\\" vegetables such as lettuce, broccoli, and peas thrive in the lower temperatures of early spring (and fall).<br \\/><br \\/>2.Plant tall vegetables on the north side of the garden, such as pole beans on a trellis or sweet corn, to avoid shading shorter plants. If you do receive some shade in your garden, reserve it for little, cool-season vegetables.<br \\/><br \\/>3.The majority of vegetables are annuals (planted each year). Provide permanent places or beds if you intend to plant \\\"perennial\\\" crops such as asparagus, rhubarb, and other herbs.<br \\/><br \\/>4.Keep in mind that some crops mature swiftly and have a short harvest season (radishes, bush beans).<\\/p>\",\"text_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18,\"sizes\":[]},\"typography_font_weight\":\"400\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"278a8ac8\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"stretch_section\":\"section-stretched\"},\"elements\":[{\"id\":\"77de13b5\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"4c7eb7b3\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong>TP30 GreenWizard<\\/strong><\\/p><p><strong>Contact Us: syuu0024@student.monash.edu<\\/strong><\\/p>\",\"_padding\":{\"unit\":\"em\",\"top\":\"2\",\"right\":\"0\",\"bottom\":\"2\",\"left\":\"2\",\"isLinked\":false},\"_padding_tablet\":{\"unit\":\"em\",\"top\":\"\",\"right\":\"\",\"bottom\":\"\",\"left\":\"\",\"isLinked\":true},\"_padding_mobile\":{\"unit\":\"em\",\"top\":\"\",\"right\":\"\",\"bottom\":\"\",\"left\":\"\",\"isLinked\":true},\"_element_width\":\"inherit\",\"_background_background\":\"classic\",\"_background_color\":\"#000000\",\"__globals__\":{\"_background_color\":\"\"},\"text_color\":\"#FFFFFF\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]');
