\\"textAlign\\\":\\\"center\\\"} -->\\n<h2 class=\\\"has-text-align-center\\\"><strong>What You Need to Know<\\/strong><\\/h2>\\n<!-- \\/wp:heading --><!-- wp:columns {\\\"align\\\":\\\"full\\\"} -->\\n<div class=\\\"wp-block-columns alignfull\\\"><!-- wp:column -->\\n<div class=\\\"wp-block-column\\\"><!-- wp:visualizer\\/chart {\\\"id\\\":261,\\\"route\\\":\\\"renderChart\\\"} \\/--><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns --><!-- wp:columns {\\\"verticalAlignment\\\":\\\"center\\\",\\\"align\\\":\\\"full\\\"} -->\\n<div class=\\\"wp-block-columns alignfull are-vertically-aligned-center\\\"><!-- wp:column {\\\"verticalAlignment\\\":\\\"center\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:group -->\\n<div class=\\\"wp-block-group\\\"><!-- wp:paragraph {\\\"align\\\":\\\"left\\\"} -->\\n<p class=\\\"has-text-align-left\\\">In areas where 90% of the environment around the home is green, only 10.2% of the residents feel unhealthy, as compared with areas in which 10% of the environment is green, where 15.5% of the residents feel unhealthy.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<!-- \\/wp:group --><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns --><!-- wp:group -->\\n<div class=\\\"wp-block-group\\\"><!-- wp:columns {\\\"align\\\":\\\"wide\\\"} -->\\n<div class=\\\"wp-block-columns alignwide\\\"><!-- wp:column {\\\"verticalAlignment\\\":\\\"center\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:media-text {\\\"mediaId\\\":330,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/mike-benna-sbivq9ewetq-unsplash-2\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text alignwide is-stacked-on-mobile\\\">\\n<figure class=\\\"wp-block-media-text__media\\\"><img class=\\\"wp-image-330 size-full\\\" src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/mike-benna-SBiVq9eWEtQ-unsplash-2-1024x683.jpg\\\" alt=\\\"\\\" \\/><\\/figure>\\n<div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-text-align-left\\\">19 % of Melbourne are green spaces.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<\\/div>\\n<!-- \\/wp:media-text --><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns --><\\/div>\\n<!-- \\/wp:group --><!-- wp:media-text {\\\"align\\\":\\\"\\\",\\\"mediaPosition\\\":\\\"right\\\",\\\"mediaId\\\":331,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/matt-zhang-mkpdfv5qn2u-unsplash-2\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text has-media-on-the-right is-stacked-on-mobile\\\">\\n<figure class=\\\"wp-block-media-text__media\\\"><img class=\\\"wp-image-331 size-full\\\" src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/matt-zhang-mKpDfV5qn2U-unsplash-2-1024x683.jpg\\\" alt=\\\"\\\" \\/><\\/figure>\\n<div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-text-align-left\\\">people who lived more than a kilometre from greenspaces were 1.42 times more likely to be stressed than people living within 300 metres of greenspaces.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<\\/div>\\n<!-- \\/wp:media-text --><!-- wp:media-text {\\\"align\\\":\\\"\\\",\\\"mediaId\\\":332,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/annie-spratt-tb4gf7ddcjy-unsplash-3\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text is-stacked-on-mobile\\\">\\n<figure class=\\\"wp-block-media-text__media\\\"><img class=\\\"wp-image-332 size-full\\\" src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/annie-spratt-tB4Gf7ddcJY-unsplash-3-1024x682.jpg\\\" alt=\\\"\\\" \\/><\\/figure>\\n<div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-text-align-left\\\">People living in more than 20 percent of greenspaces are much more likely to engage in physical activity.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<\\/div>\\n<!-- \\/wp:media-text --><!-- wp:columns {\\\"align\\\":\\\"full\\\"} -->\\n<div class=\\\"wp-block-columns alignfull\\\"><!-- wp:column {\\\"verticalAlignment\\\":\\\"center\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:visualizer\\/chart {\\\"id\\\":263,\\\"route\\\":\\\"renderChart\\\"} \\/--><\\/div>\\n<!-- \\/wp:column --><!-- wp:column -->\\n<div class=\\\"wp-block-column\\\"><!-- wp:visualizer\\/chart {\\\"id\\\":265,\\\"route\\\":\\\"renderChart\\\"} \\/--><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns --><!-- wp:paragraph -->\\n<p>From the graph, we can know that only 79% of people in Melbourne have green spaces around their housing, while 98% of people in Canberra have green spaces around their accommodation. Melbourne\'s per capita green area is only 116.46 square kilometres, and Canberra has 353.355.<\\/p>\\n<!-- \\/wp:paragraph --><!-- wp:paragraph -->\\n<p>If you want to have and take care of your own green space, you can click the button to know more.<\\/p>\\n<!-- \\/wp:paragraph --><!-- wp:buttons -->\\n<div class=\\\"wp-block-buttons\\\"><!-- wp:button {\\\"align\\\":\\\"center\\\",\\\"className\\\":\\\"is-style-outline\\\"} -->\\n<div class=\\\"wp-block-button aligncenter is-style-outline\\\"><a class=\\\"wp-block-button__link\\\" href=\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/greenspacehome\\/growvegetable\\/\\\">Know More<\\/a><\\/div>\\n<!-- \\/wp:button --><\\/div>\\n<!-- \\/wp:buttons --><!-- wp:image {\\\"align\\\":\\\"full\\\",\\\"id\\\":338,\\\"sizeSlug\\\":\\\"full\\\",\\\"linkDestination\\\":\\\"none\\\"} -->\\n<figure class=\\\"wp-block-image alignfull size-full\\\"><img class=\\\"wp-image-338\\\" src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/Screenshot-2022-04-07-123330.png\\\" alt=\\\"\\\" \\/><\\/figure>\\n<!-- \\/wp:image --><!-- wp:paragraph -->\\n<p>\\u00a0<\\/p>\\n<!-- \\/wp:paragraph -->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]');
