ter\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:group -->\\n<div class=\\\"wp-block-group\\\"><!-- wp:paragraph -->\\n<p>In areas where 90% of the environment around the home is green, only 10.2% of the residents feel unhealthy, as compared with areas in which 10% of the environment is green, where 15.5% of the residents feel unhealthy.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div>\\n<!-- \\/wp:group --><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns -->\\n\\n<!-- wp:group -->\\n<div class=\\\"wp-block-group\\\"><!-- wp:columns {\\\"align\\\":\\\"wide\\\"} -->\\n<div class=\\\"wp-block-columns alignwide\\\"><!-- wp:column {\\\"verticalAlignment\\\":\\\"center\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:media-text {\\\"mediaId\\\":330,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/mike-benna-sbivq9ewetq-unsplash-2\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text alignwide is-stacked-on-mobile\\\"><figure class=\\\"wp-block-media-text__media\\\"><img src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/mike-benna-SBiVq9eWEtQ-unsplash-2-1024x683.jpg\\\" alt=\\\"\\\" class=\\\"wp-image-330 size-full\\\"\\/><\\/figure><div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-large-font-size\\\">19 % of Melbourne are green spaces.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div><\\/div>\\n<!-- \\/wp:media-text --><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns --><\\/div>\\n<!-- \\/wp:group -->\\n\\n<!-- wp:media-text {\\\"align\\\":\\\"\\\",\\\"mediaPosition\\\":\\\"right\\\",\\\"mediaId\\\":331,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/matt-zhang-mkpdfv5qn2u-unsplash-2\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text has-media-on-the-right is-stacked-on-mobile\\\"><figure class=\\\"wp-block-media-text__media\\\"><img src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/matt-zhang-mKpDfV5qn2U-unsplash-2-1024x683.jpg\\\" alt=\\\"\\\" class=\\\"wp-image-331 size-full\\\"\\/><\\/figure><div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-large-font-size\\\">people who lived more than a kilometre from greenspaces were 1.42 times more likely to be stressed than people living within 300 metres of greenspaces.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div><\\/div>\\n<!-- \\/wp:media-text -->\\n\\n<!-- wp:media-text {\\\"align\\\":\\\"\\\",\\\"mediaId\\\":332,\\\"mediaLink\\\":\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/296-2\\/annie-spratt-tb4gf7ddcjy-unsplash-3\\/\\\",\\\"mediaType\\\":\\\"image\\\"} -->\\n<div class=\\\"wp-block-media-text is-stacked-on-mobile\\\"><figure class=\\\"wp-block-media-text__media\\\"><img src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/annie-spratt-tB4Gf7ddcJY-unsplash-3-1024x682.jpg\\\" alt=\\\"\\\" class=\\\"wp-image-332 size-full\\\"\\/><\\/figure><div class=\\\"wp-block-media-text__content\\\"><!-- wp:paragraph {\\\"placeholder\\\":\\\"Content\\u2026\\\",\\\"fontSize\\\":\\\"large\\\"} -->\\n<p class=\\\"has-large-font-size\\\">People living in more than 20 percent of greenspaces are much more likely to engage in physical activity.<\\/p>\\n<!-- \\/wp:paragraph --><\\/div><\\/div>\\n<!-- \\/wp:media-text -->\\n\\n<!-- wp:columns {\\\"align\\\":\\\"full\\\"} -->\\n<div class=\\\"wp-block-columns alignfull\\\"><!-- wp:column {\\\"verticalAlignment\\\":\\\"center\\\"} -->\\n<div class=\\\"wp-block-column is-vertically-aligned-center\\\"><!-- wp:visualizer\\/chart {\\\"id\\\":263,\\\"lazy\\\":-1,\\\"route\\\":\\\"renderChart\\\"} \\/--><\\/div>\\n<!-- \\/wp:column -->\\n\\n<!-- wp:column -->\\n<div class=\\\"wp-block-column\\\"><!-- wp:visualizer\\/chart {\\\"id\\\":265,\\\"lazy\\\":-1,\\\"route\\\":\\\"renderChart\\\"} \\/--><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns -->\\n\\n<!-- wp:paragraph -->\\n<p>From the graph, we can know that only 79% of people in Melbourne have green spaces around their housing, while 98% of people in Canberra have green spaces around their accommodation. Melbourne\'s per capita green area is only 116.46 square kilometres, and Canberra has 353.355.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:paragraph -->\\n<p>If you want to have and take care of your own green space, you can click the button to know more.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:buttons -->\\n<div class=\\\"wp-block-buttons\\\"><!-- wp:button {\\\"align\\\":\\\"center\\\",\\\"className\\\":\\\"is-style-outline\\\"} -->\\n<div class=\\\"wp-block-button aligncenter is-style-outline\\\"><a class=\\\"wp-block-button__link\\\" href=\\\"https:\\/\\/greenspacesvic.azurewebsites.net\\/greenspacehome\\/elementor-155\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Know More<\\/a><\\/div>\\n<!-- \\/wp:button --><\\/div>\\n<!-- \\/wp:buttons -->\\n\\n<!-- wp:columns -->\\n<div class=\\\"wp-block-columns\\\"><!-- wp:column -->\\n<div class=\\\"wp-block-column\\\"><!-- wp:quote -->\\n<blockquote class=\\\"wp-block-quote\\\"><p><strong><em>Look deep into nature, and then you will understand everything better<\\/em><\\/strong><\\/p><\\/blockquote>\\n<!-- \\/wp:quote --><\\/div>\\n<!-- \\/wp:column -->\\n\\n<!-- wp:column -->\\n<div class=\\\"wp-block-column\\\"><!-- wp:image {\\\"id\\\":341,\\\"sizeSlug\\\":\\\"large\\\",\\\"linkDestination\\\":\\\"none\\\"} -->\\n<figure class=\\\"wp-block-image size-large\\\"><img src=\\\"\\/wp-content\\/uploads\\/2022\\/04\\/pat-whelen-tZ63OgpZLUE-unsplash-1-edited-scaled.jpg\\\" alt=\\\"\\\" class=\\\"wp-image-341\\\"\\/><\\/figure>\\n<!-- \\/wp:image --><\\/div>\\n<!-- \\/wp:column --><\\/div>\\n<!-- \\/wp:columns -->\\n\\n<!-- wp:image {\\\"align\\\":\\\"full\\\",\\\"id\\\":338,\\\"sizeSlug\\\":