INSERT INTO `wp_posts` VALUES (155,1,'2022-04-06 09:07:50','2022-04-06 09:07:50','<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2><a href=\"https://greenspacesvic.azurewebsites.net/\" rel=\"nofollow\">GREEN SPACES</a></h2>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"70\" height=\"70\" src=\"/wp-content/uploads/2022/04/cropped-logo.png\" alt=\"\" loading=\"lazy\" />															\n			<ul id=\"menu-top-navigation-menu\"><li id=\"menu-item-599\"><a href=\"https://greenspacesvic.azurewebsites.net/\">Home</a></li>\n<li id=\"menu-item-596\"><a href=\"https://greenspacesvic.azurewebsites.net/knowgreenspaces/\">Education</a></li>\n<li id=\"menu-item-623\"><a href=\"https://greenspacesvic.azurewebsites.net/greenspacehome/growvegetable/\">GrowYourVegetable</a></li>\n<li id=\"menu-item-597\"><a href=\"https://greenspacesvic.azurewebsites.net/find-herbs-vegetable/\">Find herbs &#038; Vegetable</a></li>\n<li id=\"menu-item-594\"><a href=\"https://greenspacesvic.azurewebsites.net/greenspacehome/vegetables-data-visualisation-2/\">Vegetables Data Visualisation</a></li>\n</ul>		\n		<h1><strong>Vegetable Gardening</strong></h1><p> </p><h1><strong> for Beginners</strong></h1>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-divider{--divider-border-style:none;--divider-border-width:1px;--divider-color:#2c2c2c;--divider-icon-size:20px;--divider-element-spacing:10px;--divider-pattern-height:24px;--divider-pattern-size:20px;--divider-pattern-url:none;--divider-pattern-repeat:repeat-x}.elementor-widget-divider .elementor-divider{display:-webkit-box;display:-ms-flexbox;display:flex}.elementor-widget-divider .elementor-divider__text{font-size:15px;line-height:1;max-width:95%}.elementor-widget-divider .elementor-divider__element{margin:0 var(--divider-element-spacing);-ms-flex-negative:0;flex-shrink:0}.elementor-widget-divider .elementor-icon{font-size:var(--divider-icon-size)}.elementor-widget-divider .elementor-divider-separator{display:-webkit-box;display:-ms-flexbox;display:flex;margin:0;direction:ltr}.elementor-widget-divider--view-line_icon .elementor-divider-separator,.elementor-widget-divider--view-line_text .elementor-divider-separator{-webkit-box-align:center;-ms-flex-align:center;align-items:center}.elementor-widget-divider--view-line_icon .elementor-divider-separator:after,.elementor-widget-divider--view-line_icon .elementor-divider-separator:before,.elementor-widget-divider--view-line_text .elementor-divider-separator:after,.elementor-widget-divider--view-line_text .elementor-divider-separator:before{display:block;content:\"\";border-bottom:0;-webkit-box-flex:1;-ms-flex-positive:1;flex-grow:1;border-top:var(--divider-border-width) var(--divider-border-style) var(--divider-color)}.elementor-widget-divider--element-align-left .elementor-divider .elementor-divider-separator>.elementor-divider__svg:first-of-type{-webkit-box-flex:0;-ms-flex-positive:0;flex-grow:0;-ms-flex-negative:100;flex-shrink:100}.elementor-widget-divider--element-align-left .elementor-divider-separator:before{content:none}.elementor-widget-divider--element-align-left .elementor-divider__element{margin-left:0}.elementor-widget-divider--element-align-right .elementor-divider .elementor-divider-separator>.elementor-divider__svg:last-of-type{-webkit-box-flex:0;-ms-flex-positive:0;flex-grow:0;-ms-flex-negative:100;flex-shrink:100}.elementor-widget-divider--element-align-right .elementor-divider-separator:after{content:none}.elementor-widget-divider--element-align-right .elementor-divider__element{margin-right:0}.elementor-widget-divider:not(.elementor-widget-divider--view-line_text):not(.elementor-widget-divider--view-line_icon) .elementor-divider-separator{border-top:var(--divider-border-width) var(--divider-border-style) var(--divider-color)}.elementor-widget-divider--separator-type-pattern{--divider-border-style:none}.elementor-widget-divider--separator-type-pattern.elementor-widget-divider--view-line .elementor-divider-separator,.elementor-widget-divider--separator-type-pattern:not(.elementor-widget-divider--view-line) .elementor-divider-separator:after,.elementor-widget-divider--separator-type-pattern:not(.elementor-widget-divider--view-line) .elementor-divider-separator:before,.elementor-widget-divider--separator-type-pattern:not([class*=elementor-widget-divider--view]) .elementor-divider-separator{width:100%;min-height:var(--divider-pattern-height);-webkit-mask-size:var(--divider-pattern-size) 100%;mask-size:var(--divider-pattern-size) 100%;-webkit-mask-repeat:var(--divider-pattern-repeat);mask-repeat:var(--divider-pattern-repeat);background-color:var(--divider-color);-webkit-mask-image:var(--divider-pattern-url);mask-image:var(--divider-pattern-url)}.elementor-widget-divider--no-spacing{--divider-pattern-size:auto}.elementor-widget-divider--bg-round{--divider-pattern-repeat:round}.rtl .elementor-widget-divider .elementor-divider__text{direction:rtl}</style>		\n		<h2><strong>what plant do you want to grow</strong></h2>		\n		<p>Get information about the plant you may want to grow</p>		\n			<a href=\"https://greenspacesvic.azurewebsites.net/find-herbs-vegetable/\" role=\"button\">\n						Learn More\n					</a>\n															<img width=\"620\" height=\"249\" src=\"/wp-content/uploads/2022/04/greenplants-1024x412.png\" alt=\"\" loading=\"lazy\" srcset=\"/wp-content/uploads/2022/04/greenplants-1024x412.png 1024w, /wp-content/uploads/2022/04/greenplants-300x121.png 300w, /wp-content/uploads/2022/04/greenplants-768x309.png 768w, /wp-content/uploads/2022/04/greenplants-1536x618.png 1536w, /wp-content/uploads/2022/04/greenplants-2048x824.png 2048w, /wp-content/uploads/2022/04/greenplants-1568x631.png 1568w\" sizes=\"(max-width: 620px) 100vw, 620px\" />															\n		<h2><strong>Pick the Right Location</strong></h2>		\n															<img width=\"620\" height=\"705\" src=\"/wp-content/uploads/2022/04/salad-901x1024.png\" alt=\"\" loading=\"lazy\" srcset=\"/wp-content/uploads/2022/04/salad-901x1024.png 901w, /wp-content/uploads/2022/04/salad-264x300.png 264w, /wp-content/uploads/2022/04/salad-768x872.png 768w, /wp-content/uploads/2022/04/salad.png 1236w\" sizes=\"(max-width: 620px) 100vw, 620px\" />															\n		<p>1.Sunny location: Most veggies require 6 to 8 hours in direct sunlight each day. A few vegetables (mainly the leafy ones) can endure some shade.</p>\n<p> </p>\n<p>2.Drains effectively and does not remain wet: If your soil is poorly drained and water pools, grow vegetables in a raised bed or elevated row to improve drainage. Moist soil implies wet roots, which can decay over time. If your soil is rocky, till it and remove the rocks, since they will interfere with root growth and make your plants weaker.</p>\n<p> </p>\n<p>3.Stable and wind-free: Avoid locations with strong gusts that could knock over your young plants or prevent pollinators from doing their job. You also don\'t want to plant in an area that gets a lot of foot traffic or floods readily. Plant at a spot that would make Goldilocks happy—somewhere \"just right.\"</p>\n<p> </p>\n<p>4.Soil that is nutrient-dense. Your plants are fed by the earth. Poor, sickly plants will result from thin, nutrient-deficient soil. To help your plants grow, provide plenty of organic stuff. Learn how to prepare your soil for vegetable gardening.</p>		\n		<h2><strong>Where and When to Plant</strong></h2>		\n															<img width=\"620\" height=\"697\" src=\"/wp-content/uploads/2022/04/small-plant-911x1024.png\" alt=\"\" loading=\"lazy\" srcset=\"/wp-content/uploads/2022/04/small-plant-911x1024.png 911w, /wp-content/uploads/2022/04/small-plant-267x300.png 267w, /wp-content/uploads/2022/04/small-plant-768x863.png 768w, /wp-content/uploads/2022/04/small-plant-1366x1536.png 1366w, /wp-content/uploads/2022/04/small-plant.png 1370w\" sizes=\"(max-width: 620px) 100vw, 620px\" />															\n		<p>1.Vegetables are not all planted at the same time. \"Cool-season\" vegetables such as lettuce, broccoli, and peas thrive in the lower temperatures of early spring (and fall).<br /><br />2.Plant tall vegetables on the north side of the garden, such as pole beans on a trellis or sweet corn, to avoid shading shorter plants. If you do receive some shade in your garden, reserve it for little, cool-season vegetables.<br /><br />3.The majority of vegetables are annuals (planted each year). Provide permanent places or beds if you intend to plant \"perennial\" crops such as asparagus, rhubarb, and other herbs.<br /><br />4.Keep in mind that some crops mature swiftly and have a short harvest season (radishes, bush beans).</p><p><strong>TP30 GreenWizard</strong></p><p><strong>Contact Us: syuu0024@student.monash.edu</strong></p>','SearchHomePage','','publish','closed','closed','','growvegetable','','','2022-04-06 09:07:50','2022-04-06 09:07:50','',6,'https://greenspacesvic.azurewebsites.net/?page_id=155',0,'page','',0);
