INSERT INTO `wp_posts` VALUES (387,1,'2022-04-07 07:36:36','2022-04-07 07:36:36','<p><style>/*! elementor - v3.6.2 - 04-04-2022 */<br />\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style></p>\n<h2><a href=\"https://greenspacesvic.azurewebsites.net/\" rel=\"nofollow\">GREEN SPACES</a></h2>\n<p><style>/*! elementor - v3.6.2 - 04-04-2022 */<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style></p>\n<p><img src=\"/wp-content/uploads/2022/04/cropped-logo.png\" alt=\"\" width=\"70\" height=\"70\" /></p>\n\n<!-- wp:image {\"align\":\"full\",\"id\":344,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image alignfull size-large\"><a href=\"https://greenspacesvic.azurewebsites.net/\"><img src=\"/wp-content/uploads/2022/04/Screenshot-2022-04-07-1229-1024x54.png\" alt=\"\" class=\"wp-image-344\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:cover {\"url\":\"/wp-content/uploads/2022/04/eduhome-1024x560.jpg\",\"id\":274,\"dimRatio\":50,\"isDark\":false,\"align\":\"full\",\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-cover alignfull is-light\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-274\" alt=\"\" src=\"/wp-content/uploads/2022/04/eduhome-1024x560.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:heading {\"level\":1} -->\n<h1>Green Space Around You </h1>\n<!-- /wp:heading --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading -->\n<h2><strong>What You Need to Know</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"align\":\"full\"} -->\n<div class=\"wp-block-columns alignfull\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:visualizer/chart {\"id\":261,\"route\":\"renderChart\"} /--></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"verticalAlignment\":\"center\",\"align\":\"full\"} -->\n<div class=\"wp-block-columns alignfull are-vertically-aligned-center\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:paragraph -->\n<p>In areas where 90% of the environment around the home is green, only 10.2% of the residents feel unhealthy, as compared with areas in which 10% of the environment is green, where 15.5% of the residents feel unhealthy.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:media-text {\"mediaId\":330,\"mediaLink\":\"https://greenspacesvic.azurewebsites.net/296-2/mike-benna-sbivq9ewetq-unsplash-2/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"/wp-content/uploads/2022/04/mike-benna-SBiVq9eWEtQ-unsplash-2-1024x683.jpg\" alt=\"\" class=\"wp-image-330 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>19 % of Melbourne are green spaces.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaPosition\":\"right\",\"mediaId\":331,\"mediaLink\":\"https://greenspacesvic.azurewebsites.net/296-2/matt-zhang-mkpdfv5qn2u-unsplash-2/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"/wp-content/uploads/2022/04/matt-zhang-mKpDfV5qn2U-unsplash-2-1024x683.jpg\" alt=\"\" class=\"wp-image-331 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>people who lived more than a kilometre from greenspaces were 1.42 times more likely to be stressed than people living within 300 metres of greenspaces.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaId\":332,\"mediaLink\":\"https://greenspacesvic.azurewebsites.net/296-2/annie-spratt-tb4gf7ddcjy-unsplash-3/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"/wp-content/uploads/2022/04/annie-spratt-tB4Gf7ddcJY-unsplash-3-1024x682.jpg\" alt=\"\" class=\"wp-image-332 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>People living in more than 20 percent of greenspaces are much more likely to engage in physical activity.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:columns {\"align\":\"full\"} -->\n<div class=\"wp-block-columns alignfull\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:visualizer/chart {\"id\":263,\"route\":\"renderChart\"} /--></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:visualizer/chart {\"id\":265,\"route\":\"renderChart\"} /--></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>From the graph, we can know that only 79% of people in Melbourne have green spaces around their housing, while 98% of people in Canberra have green spaces around their accommodation. Melbourne\'s per capita green area is only 116.46 square kilometres, and Canberra has 353.355.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you want to have and take care of your own green space, you can click the button to know more.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"align\":\"center\"} -->\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\" href=\"https://greenspacesvic.azurewebsites.net/greenspacehome/elementor-155/\" target=\"_blank\" rel=\"noreferrer noopener\">Know More</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:quote -->\n<blockquote><p><strong><em>Look deep into nature, and then you will understand everything better</em></strong></p></blockquote>\n<!-- /wp:quote --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":341,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure><img src=\"/wp-content/uploads/2022/04/pat-whelen-tZ63OgpZLUE-unsplash-1-edited-scaled.jpg\" alt=\"\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:image {\"align\":\"full\",\"id\":338,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignfull size-full\"><img src=\"/wp-content/uploads/2022/04/Screenshot-2022-04-07-123330.png\" alt=\"\" class=\"wp-image-338\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<h5><strong>TP30 GreenWizard</strong></h5>\n<h5><strong>Contact Us: syuu0024@student.monash.edu</strong></h5>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','educationpage','','trash','closed','closed','','__trashed-5','','','2022-04-07 07:36:36','2022-04-07 07:36:36','',0,'https://greenspacesvic.azurewebsites.net/?page_id=387',0,'page','',0);
