INSERT INTO `wp_posts` VALUES (415,1,'2022-04-07 10:01:49','2022-04-07 10:01:49','<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"white\",\"className\":\"is-style-fill\"} /--></div>\n<!-- /wp:buttons -->\n\n<!-- wp:navigation {\"ref\":606,\"customTextColor\":\"#82d576\",\"backgroundColor\":\"foreground\",\"showSubmenuIcon\":false,\"align\":\"full\",\"layout\":{\"type\":\"flex\",\"justifyContent\":\"right\",\"orientation\":\"horizontal\"},\"fontSize\":\"normal\"} /-->\n\n<!-- wp:html -->\n<p class=\"has-text-align-left\" style=\"margin-left:80px\">Visualization plots include packed bubbles, treemap, and bar charts which are plotted using Tableau public and the vegetable information dataset and it includes information about 200 vegetables and herbs which can grow at different times of a year (specific season).</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>Packed bubbles for all the vegetables and herbs:</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"width\":800,\"height\":600,\"linkDestination\":\"custom\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image is-resized is-style-default\"><a href=\"#\" style=\"margin-left:80px\"><img src=\"https://public.tableau.com/static/images/Ve/Vegetabledatasetpackedbubbles/Sheet1/1_rss.png\" alt=\"Sheet 1 \" width=\"800\" height=\"600\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>TreeMap :</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\">Another data visualization plot I have is the treemap which gives more detailed information about all the vegetables and herbs along with other attributes/ columns present in the vegetable information dataset such as sow direction, sow depth, germination time, etc.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":534,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure style=\"margin-left:80px\" class=\"wp-block-image size-large\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1024x580.png\" alt=\"\" class=\"wp-image-534\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p style=\"margin-left:80px\"><strong>Bar chart:</strong> It shows three categories and eight vegetables selected as filters and they are common ones such as carrot, cabbage, broccoli, cauliflower, etc. It\'s based on Frost, tender or hardy, and days to maturity.</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":538,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure style=\"margin-left:80px\" class=\"wp-block-image size-full\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1.png\" alt=\"\" class=\"wp-image-538\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><object></object></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>Sources :</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><a href=\"https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><a href=\"https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><a href=\"https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"black\",\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-black-background-color has-text-color has-background\"><strong>TP30 Green Wizards</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Vegetables Data Visualisation','','publish','closed','closed','','vegetables-data-visualisation','','','2022-04-07 10:01:49','2022-04-07 10:01:49','',6,'https://greenspacesvic.azurewebsites.net/?page_id=415',1,'page','',0);
INSERT INTO `wp_posts` VALUES (423,1,'2022-04-07 10:04:48','2022-04-07 10:04:48','[[\"name\",\"name\",\"plant class\",\"Best Time to Sow (Australia)\",\"Sowing Depth (mm) \\u2193\",\"Plant spacing (cm) \\u2194\",\"Frost Tender or Hardy\",\"Sow Direct or Raise Seedlings\",\"Germination time (days)\",\"Days to maturity\",\"Rrow spacing (cm) \\u2261\",\"friendly plant\",\"friendly reason\",\"unfriendly plant\",\"unfriendly reason\"],[\"Amaranth\",\"amaranth\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21935\",\"\\u219450\\u00a0\",\"FT\",\"D\",\"5-20 days\",\"50-60\",\"\\u226150-80\",\"corn\",\"Amaranth  plant with corn to shade the soil and retain water.\",\"Weeds\",\"Amaranthus seedlings can be overwhelmed by too many weeds and should be controlled.\"],[\"Artichoke\",\"artichoke\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21936\",\"\\u2194150-200\",\"H\",\"D\",\"15-25 days\",\"290-400\",\"\\u2261150-250\",\"peas, cabbage, sunflowers, tarragon\",\"These plants will not compete for nutrients.\",\"artichoke companion planting isn\\u2019t recommended in close quarters\",\"They spread out with huge leaves that can easily shade or muscle out smaller plants.\"],[\"Asparagus\",\"asparagus\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u219310\",\"\\u219420-40\",\"FT\",\"D\",\"20-35 days\",\"2-3 years\",\"\\u2261100\",\"flowering marigolds,  nasturtiums,  parsley, basil\",\"they will repel most of the pests that affect marigolds and basil plants.\",\"fennel, garlic\",\"they will compete for the same nutrients.\"],[\"Broad Bean\",\"broad bean\",\"vegetable\",\"Mar, Apr,May, Aug, Sep\",\"\\u219340-50\",\"\\u219415-25\",\"H\",\"D\",\"10-20 days\",\"90-150\",\"\\u226160-80\",\"potatoes, cucumber, corn and spinach\",\"beans are legumes, they have the capacity to enrich the well-drained soil by nitrogen fixing. \",\"Broccoli, Cauliflower, Kale, Mustard, Cress, Chives, Garlic, Leeks\",\"beans seem to have a negative effect on vegetables from onion and cabbage families\"],[\"Bush Bean\",\"bush bean\",\"vegetable\",\"Oct, Nov, Dec, Jan\",\"\\u219320-30\",\"\\u21947-15\",\"FT\",\"D\",\"7-15 days\",\"50-80\",\"\\u226140-60\",\"potatoes, cucumber, corn and spinach\",\"beans are legumes, they have the capacity to enrich the well-drained soil by nitrogen fixing. \",\"Broccoli, Cauliflower, Kale, Mustard, Cress, Chives, Garlic, Leeks\",\"beans seem to have a negative effect on vegetables from onion and cabbage families\"],[\"Climbing Bean\",\"climbing bean\",\"vegetable\",\"Oct, Nov, Dec\",\"\\u219320-30\",\"\\u219410-25\",\"FT\",\"D\",\"7-15 days\",\"70-85\",\"\\u2261100\",\"potatoes, cucumber, corn and spinach\",\"beans are legumes, they have the capacity to enrich the well-drained soil by nitrogen fixing. \",\"Broccoli, Cauliflower, Kale, Mustard, Cress, Chives, Garlic, Leeks\",\"beans seem to have a negative effect on vegetables from onion and cabbage families\"],[\"Beetroot\",\"beetroot\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"\\u219320-30\",\"\\u21945-10\",\"H\",\"D\",\"15-25 days\",\"55-85\",\"\\u226130-40\",\"most vegetables\",\"Beets are easy to grow since they are compatible with most vegetables as well as other garden plants. Beets do not take a lot of time to mature and give desired yields provided you allow them a breathing space when you grow together with other plants.\",\"mustard, pole beans\",\"\"],[\"Broccoli\",\"broccoli\",\"vegetable\",\"Nov, Dec, Jan, Feb, Mar\",\"\\u21936\",\"\\u219435-45\",\"H\",\"R/D\",\"15-25 days\",\"60-120\",\"\\u226140-60\",\"beans, beets, carrots, melons, cucumbers, lettuce, parsnips, peas, squash, spinach\",\"\",\"squash, strawberries, tomatoes, peppers\",\"all of which can have allelopathic effects on these two cruciferous veggies.\"],[\"Brussels Sprouts\",\"brussels sprouts\",\"vegetable\",\"Oct, Nov, Dec, Jan, Feb\",\"\\u21936\",\"\\u219450-75\",\"H\",\"R/D\",\"6-12 days\",\"80-140\",\"\\u226190\",\"Eggplants, Peppers, Potatoes\",\"Take away nutrients from your brussels sprouts. Take away sunlight from your sprouts. Attract pests that can hurt your brussels sprouts.\",\"tomatoes\",\"They have many of the same nutrients requirements as the tomatoes.\"],[\"Burdock\",\"burdock\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb\",\"\\u219315\",\"\\u219460\",\"H\",\"D/R\",\"10-12 days\",\"120-140\",\"\\u226160\",\"Asparagus, Beans, Peas, Squash\",\"Because burdock has such a long taproot, it pulls up nutrients from deeper in the soil, so companion plants should be anything with shallow roots.\",\"Onions, Radish, Potatoes, Carrot\",\"Don\\u2019t plant with deep-rooted vegetables or they will compete with burdock for nutrients.\"],[\"Cabbage\",\"cabbage\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"\\u21936\",\"\\u219440-50\",\"H\",\"R/D\",\"6-12 days\",\"60-120\",\"\\u226150-70\",\"celery, dill, rosemary, onion mints, thyme\",\"these types of herbs help keep many pests away.\",\"basil\",\"they will hinder their growth.\"],[\"Chinese Cabbage\",\"chinese cabbage\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"\\u21936\",\"\\u219430\",\"H\",\"D\",\"6-12 days\",\"60-80\",\"\\u226140\",\"celery, dill, rosemary, onion mints, thyme\",\"these types of herbs help keep many pests away.\",\"basil\",\"they will hinder their growth.\"],[\"Cape Gooseberry\",\"cape gooseberry\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21934\",\"\\u219450\",\"FT\",\"R\",\"15-30 days\",\"140-160\",\"\\u2261100\",\"Mint Nasturtiums Oregano\",\"attracting beneficial insects, repelling pests,  providing nutrients,\",\"Potatoes\",\"provide too much shade for  plant.\"],[\"Capsicum\",\"capsicum\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21934\",\"\\u219440-60\",\"FT\",\"R/D\",\"10-20 days\",\"70-110\",\"\\u226180-100\",\"Carrots, cucumbers, radishes, squash\",\"they growth together good.\",\"Fennel\",\"It attracts certain insects and pests\"],[\"Carrot\",\"carrot\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"\\u21934\",\"\\u21943-8\",\"Half Hardy\",\"D\",\"10-20 days\",\"70-120\",\"\\u226125-30\",\"beans, Brassicas, chives, leeks, lettuce, onions, peas, peppers, pole beans, radish, rosemary, sage, tomatoes\",\"\",\"dill, parsnips, potatoes\",\"it\'s a good idea to keep some space between root crops so they don\'t compete for available phosphorus.\"],[\"Cauliflower\",\"cauliflower\",\"vegetable\",\"Nov, Dec, Jan, Feb, Mar, Apr\",\"\\u21936\",\"\\u219445-70\",\"H\",\"R/D\",\"6-12days\",\"100-160\",\"\\u226175-90\",\"aromatic herbs , onion family plants\",\"the aromatic herbs as well as onion family plants will assist in keeping most of the pest that affect the cauliflower.\",\"strawberry, beans and tomatoes\",\"These plants tend to release chemicals that hinders the growth of cauliflower.\"],[\"Celeriac\",\"celeriac\",\"vegetable\",\"Oct, Nov, Dec, Jan\",\"\\u21934\",\"\\u219415-25\",\"H\",\"R\",\"\",\"90-140\",\"\\u226140-70\",\"brassicas, cucumbers, bush beans\",\"get high yields\",\"pumpkins, cucumbers, squash\",\"\"],[\"Celery\",\"celery\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21934\",\"\\u219415-30\",\"H\",\"R\",\"15-25 days\",\"120-140\",\"\\u226130-55\",\"beans, cucumbers, and brassicas\",\"\",\"parsley, parsnips, turnips, carrots\",\"These plants fight vigorously for the same nutrients and moisture. They do not make the best of neighbors.\"],[\"Chilli\",\"chilli\",\"vegetable\",\"Sep, Oct, Nov\",\"\\u21934\",\"\\u219440-60\",\"FT\",\"R/D\",\"10-20 days\",\"60-110\",\"\\u226180-100\",\"tomatoes, aubergines, basil, oregano, rosemary\",\"While chili plants protect neighboring herbs from tubular fungi by their roots, the chili probably profits from their essential oils. They drive away some pests that could otherwise infest their leaves.\",\"Fennel\",\"Perhaps it is due to the essential oils in the fennel.\"],[\"Sweet Corn\",\"sweet corn\",\"vegetable\",\"Oct, Nov, Dec, Jan\",\"\\u219315-25\",\"\\u219420-30\",\"FT\",\"D\",\"6-12 days\",\"80-120\",\"\\u226150-90\",\"squash, beans, cucurbit family, cucumber, melon , pumpkin , legumes\",\"tend to get the maximum yields.\",\"tomato\",\"Most likely due to both tomatoes and corn being heavy feeders. However, if your garden soil is rich enough, these plants can do well when planted close to each other.\"],[\"Cress\",\"cress\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May, Jun, Jul, Aug\",\"\\u21934\",\"\\u219415\",\"H\",\"D\",\"6-12 days\",\"30-60\",\"\\u226115\",\"broccoli, cabbage, cauliflower, Chinese cabbage, brussels sprouts.mustard, radish, turnip\",\"cress can protect them.\",\"\",\"\"],[\"Cucumber\",\"cucumber\",\"vegetable\",\"Oct, Nov, Dec\",\"\\u219310\",\"\\u219440-60\",\"FT\",\"D\",\"10-15 days\",\"60-90\",\"\\u2261100-120\",\"oregano\",\"oregano is a popular pest control herb and will do well as a companion plant.\",\"melons, potatoes, sage \",\"\"],[\"Eggplant\",\"eggplant\",\"vegetable\",\"Oct, Nov, Dec\",\"\\u21934\",\"\\u219450-75\",\"FT\",\"R/D\",\"10-20 days\",\"90-120\",\"\\u226180-90\",\"spinach, beans\",\"growing eggplant near beans is a great way to repel the potato beetle, a common pest.\",\"tomatoes, peppers, potatoes\",\"\"],[\"Endive\",\"endive\",\"vegetable\",\"Sep, Oct, Nov, Feb, Mar\",\"\\u21935\",\"\\u219420-30\",\"H\",\"R/D\",\"10-20 days\",\"50-80\",\"\\u226120-30\",\"Radish. Turnips. Parsnips\",\"protect them from pest\",\"squash varieties or pumpkins.\",\"provide too much shade for  plant.\"],[\"Kale\",\"kale\",\"vegetable\",\"Jan, Feb, Mar, Apr\",\"\\u219310\",\"\\u219440-60\",\"H\",\"R/D\",\"6-12 days\",\"50-70\",\"\\u226150-100\",\"onions, garlic, nasturtium, dills, rosemary, sage , thyme, potatoes\",\"they will repel some of the common pests that affect the plants.\",\"basil, tomatoes,  strawberries\",\"they prone to many pests.\"],[\"Kohl Rabi\",\"kohl rabi\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"\\u21936\",\"\\u219410-20\",\"H\",\"D\",\"6-12 days\",\"55-70\",\"\\u226130-40\",\"broccoli, cauliflower, collards, kale, turnip, rutabaga, cabbage, mustard, bok choy\",\"Chives, Gar