. \",\"Broccoli, Cauliflower, Kale, Mustard, Cress, Chives, Garlic, Leeks\",\"beans seem to have a negative effect on vegetables from onion and cabbage families\"],[\"Beetroot\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"15-25 days\",\"most vegetables\",\"Beets are easy to grow since they are compatible with most vegetables as well as other garden plants. Beets do not take a lot of time to mature and give desired yields provided you allow them a breathing space when you grow together with other plants.\",\"mustard, pole beans\",\"\"],[\"Broccoli\",\"vegetable\",\"Nov, Dec, Jan, Feb, Mar\",\"15-25 days\",\"beans, beets, carrots, melons, cucumbers, lettuce, parsnips, peas, squash, spinach\",\"\",\"squash, strawberries, tomatoes, peppers\",\"all of which can have allelopathic effects on these two cruciferous veggies.\"],[\"Brussels Sprouts\",\"vegetable\",\"Oct, Nov, Dec, Jan, Feb\",\"6-12 days\",\"Eggplants, Peppers, Potatoes\",\"Take away nutrients from your brussels sprouts. Take away sunlight from your sprouts. Attract pests that can hurt your brussels sprouts.\",\"tomatoes\",\"They have many of the same nutrients requirements as the tomatoes.\"],[\"Burdock\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb\",\"10-12 days\",\"Asparagus, Beans, Peas, Squash\",\"Because burdock has such a long taproot, it pulls up nutrients from deeper in the soil, so companion plants should be anything with shallow roots.\",\"Onions, Radish, Potatoes, Carrot\",\"Don\\u2019t plant with deep-rooted vegetables or they will compete with burdock for nutrients.\"],[\"Cabbage\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"6-12 days\",\"celery, dill, rosemary, onion mints, thyme\",\"these types of herbs help keep many pests away.\",\"basil\",\"they will hinder their growth.\"],[\"Chinese Cabbage\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"6-12 days\",\"celery, dill, rosemary, onion mints, thyme\",\"these types of herbs help keep many pests away.\",\"basil\",\"they will hinder their growth.\"],[\"Cape Gooseberry\",\"vegetable\",\"Sep, Oct, Nov\",\"15-30 days\",\"Mint Nasturtiums Oregano\",\"attracting beneficial insects, repelling pests,  providing nutrients,\",\"Potatoes\",\"provide too much shade for  plant.\"],[\"Capsicum\",\"vegetable\",\"Sep, Oct, Nov\",\"10-20 days\",\"Carrots, cucumbers, radishes, squash\",\"they growth together good.\",\"Fennel\",\"It attracts certain insects and pests\"],[\"Carrot\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"10-20 days\",\"beans, Brassicas, chives, leeks, lettuce, onions, peas, peppers, pole beans, radish, rosemary, sage, tomatoes\",\"\",\"dill, parsnips, potatoes\",\"it\'s a good idea to keep some space between root crops so they don\'t compete for available phosphorus.\"],[\"Cauliflower\",\"vegetable\",\"Nov, Dec, Jan, Feb, Mar, Apr\",\"6-12days\",\"aromatic herbs , onion family plants\",\"the aromatic herbs as well as onion family plants will assist in keeping most of the pest that affect the cauliflower.\",\"strawberry, beans and tomatoes\",\"These plants tend to release chemicals that hinders the growth of cauliflower.\"],[\"Celeriac\",\"vegetable\",\"Oct, Nov, Dec, Jan\",\"\",\"brassicas, cucumbers, bush beans\",\"get high yields\",\"pumpkins, cucumbers, squash\",\"\"],[\"Celery\",\"vegetable\",\"Sep, Oct, Nov\",\"15-25 days\",\"beans, cucumbers, and brassicas\",\"\",\"parsley, parsnips, turnips, carrots\",\"These plants fight vigorously for the same nutrients and moisture. They do not make the best of neighbors.\"],[\"Chilli\",\"vegetable\",\"Sep, Oct, Nov\",\"10-20 days\",\"tomatoes, aubergines, basil, oregano, rosemary\",\"While chili plants protect neighboring herbs from tubular fungi by their roots, the chili probably profits from their essential oils. They drive away some pests that could otherwise infest their leaves.\",\"Fennel\",\"Perhaps it is due to the essential oils in the fennel.\"],[\"Sweet Corn\",\"vegetable\",\"Oct, Nov, Dec, Jan\",\"6-12 days\",\"squash, beans, cucurbit family, cucumber, melon , pumpkin , legumes\",\"tend to get the maximum yields.\",\"tomato\",\"Most likely due to both tomatoes and corn being heavy feeders. However, if your garden soil is rich enough, these plants can do well when planted close to each other.\"],[\"Cress\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May, Jun, Jul, Aug\",\"6-12 days\",\"broccoli, cabbage, cauliflower, Chinese cabbage, brussels sprouts.mustard, radish, turnip\",\"cress can protect them.\",\"\",\"\"],[\"Cucumber\",\"vegetable\",\"Oct, Nov, Dec\",\"10-15 days\",\"oregano\",\"oregano is a popular pest control herb and will do well as a companion plant.\",\"melons, potatoes, sage \",\"\"],[\"Eggplant\",\"vegetable\",\"Oct, Nov, Dec\",\"10-20 days\",\"spinach, beans\",\"growing eggplant near beans is a great way to repel the potato beetle, a common pest.\",\"tomatoes, peppers, potatoes\",\"\"],[\"Endive\",\"vegetable\",\"Sep, Oct, Nov, Feb, Mar\",\"10-20 days\",\"Radish. Turnips. Parsnips\",\"protect them from pest\",\"squash varieties or pumpkins.\",\"provide too much shade for  plant.\"],[\"Kale\",\"vegetable\",\"Jan, Feb, Mar, Apr\",\"6-12 days\",\"onions, garlic, nasturtium, dills, rosemary, sage , thyme, potatoes\",\"they will repel some of the common pests that affect the plants.\",\"basil, tomatoes,  strawberries\",\"they prone to many pests.\"],[\"Kohl Rabi\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"6-12 days\",\"broccoli, cauliflower, collards, kale, turnip, rutabaga, cabbage, mustard, bok choy\",\"Chives, Garlic, Onions, and Shallots all can help keep unwanted insects and pests away from the area they are planted in.\",\"pepper, pole beans, tomato, strawberries\",\"\"],[\"Leek\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"10-20 days\",\"beets, carrot, celery, onions, spinach\",\"Leeks help repel carrot rust flies.\",\"beans, peas\",\"beans and peas do not thrive near any member of the onion family.\"],[\"Lettuce\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May\",\"6-12 days\",\"Chives and garlic\",\"They naturally repel  aphids\",\"garlic, onions, garlic, onions\",\"The allium family plants including the garlic and onions are seeming to produce chemicals that hinders their growth. In addition, the lettuce seems to compete with the same nutrients as the members of the Allium family.\"],[\"Mizuna\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"6-12 days\",\"beans, lettuce, cucumber, carrots, dill,\",\"\",\"cabbage family, bush beans, and strawberries.\",\"\"],[\"Mustard\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May, Jun, Jul, Aug\",\"6-12 days\",\"Celery, Chamomile\",\"It repels a range of brassica pests.\",\"sunflower, soybeans, dried beans\",\"these plants can suffer from the same disease problems\"],[\"Okra\",\"vegetable\",\"Oct, Nov, Dec\",\"10-20 days\",\"Cucumbers\",\"Cucumbers love water and rich soil, as does okra, so these will do well side by side\",\"Pepper\",\"Pepper plants will repel cabbage worms, which can be a destructive nuisance to okra plants.\"],[\"Onion\",\"vegetable\",\"Feb, Mar, Apr, May, Jun, Jul, Aug, Sep\",\"10-20 days\",\"cabbage\",\"\",\"peas, beans, asparagus\",\"As stated earlier asparagus competes for the same nutrients with the onions.\"],[\"Parsnip\",\"vegetable\",\"AugSep, Oct, Nov, Dec, Jan, Feb\",\"20-30 days\",\"Anise\",\"it is reputed to improve the vibrancy of all plants in close proximity.\",\"Lettuce, onions, carrots\",\"\"],[\"Pea\",\"vegetable\",\"Jan, Feb, Mar, Apr, May, Jun, Jul, Aug, Sep, Oct\",\"8-16 days\",\"beans, carrots, celery, corn\",\"they can share their care requirements, as well as help them grow better and use your gardening space more efficiently.\",\"Onions, Garlic, Leeks\",\"Plants in the allium (onion and garlic) family are not good partners for peas because they tend to stunt the growth of peas.\"],[\"Pumpkin\",\"vegetable\",\"Oct, Nov, Dec\",\"8-16 days\",\"corn, peas, radish\",\"The pumpkin will also benefit from the nitrogen fixing delivered by the legumes.\",\"potatoes\",\"\"],[\"Radish\",\"vegetable\",\"Aug, Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May, Jun\",\"5-10 days\",\"Beans, Nasturtium, Beets, Chervil\",\"can increase its yields\",\"Broccoli, Brussels sprouts, Cabbage, Cauliflower, Hyssop, Kohlrabi, Grape, Potato, Turnips\",\"\"],[\"Rhubarb\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"5-10 days\",\"Cauliflower, beans, kale, broccoli, garlic\",\"\",\"melon, black walnut, cucumber, pumpkin, dock\",\"\"],[\"Rockmelon\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"6-16 days\",\"corn\",\"Since the melons spread along the ground, they will suppress the weeds that compete for nutrients with the corn.\",\"tomato\",\"\"],[\"Rocket\",\"vegetable\",\"Sep,  Oct, Nov, Nov, Feb,Mar\",\"6-12 days\",\"onion\",\"Growing onions and arugula as companion plants will help to keep the cabbage whites from laying eggs on them.\",\"Tomatoes\",\"Sadly these two plants just don\\u2019t get on at all. Growing them near each other will result in poor growth of both plants. This is the same for all members of the nightshade family.\"],[\"Rosella\",\"vegetable\",\"Nov, Dec\",\"10-20 days\",\"Anemone\",\"maximize the flower power with this pairing. Both enjoy full sun and moist soil.\",\"\",\"\"],[\"Silverbeet\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"10-20 days\",\" Beans, brassica\",\"\",\"Corn, melon, cucurbit \",\"\"],[\"Spinach\",\"vegetable\",\"Feb, Mar, Apr, May, Jun, Jul, Aug, Sep, Oct, Nov\",\"10-25 days\",\"peas, beans, strawberries\",\"spinach benefits from the nitrogen fixing when grown together with peas and beans.\",\"potatoes\",\"Some of these farmers believe it is because of the shallow roots of the spinach. Although the potatoes are larger than the spinach, they tend to keep their roots close to the soil. This increases competition for water and nutrients that are close to the top soil. In addition, since the potatoes are taller they will block the much needed sunlight, making spinach have lower yields.\"],[\"Squash\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"6-18 days\",\"onions, radishes, beans, nasturtium, mint , catnip\",\"Because the squashes are soft and tasty they tend to attract a lot of pests. For this reason, squash benefits from the companionship of pest repellent herbs such as nasturtium, mint and catnip.\",\"pumpkins, potatoes \",\"\"],[\"Swede\",\"vegetable\",\"Sep, Oct, Nov, Jan, Feb, Mar, Apr\",\"6-12 days\",\"Onions, peas\",\"\",\"\",\"\"],[\"Tomato\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"10-20 days\",\"asparagus, basil, beans, borage, carrots, celery, chives, collards, cucumber, garlic, lettuce, marigold, mint, nasturtium, onion, parsley, and peppers\",\"\",\"Brassicas, dill, corn, kohlrabi \",\"Corn will attract tomato pests, and kohlrabi will stunt tomatoes\\u2019 growth\"],[\"Turnip\",\"vegetable\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May\",\"6-12 days\",\"tomatoes, squash and celery\",\"\",\"root vegetables\",\"they compete for space and nutrition.\"],[\"Watermelon\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"6-18 days\",\"corn\",\"Since the melons spread along the ground, they will suppress the weeds that compete for nutrients with the corn.\",\"tomato\",\"\"],[\"Zucchini\",\"vegetable\",\"Sep, Oct, Nov, Dec\",\"6-12 days\",\"Beans, corn, squash\",\"Nitrogen-fixing plants benefit all other plants\\u2014especially heavy feeders like zucchini.\",\"squash, cucumbers, pumpkins or tomatoes\",\"as they can negatively impact a variety of other vegetables planted nearby\"],[\"Anise\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, \",\"7-14 days\",\"cabbage and grapes\",\"\",\"carrots, radishes\",\"\"],[\"Basil\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb\",\"7-14 days\",\"Anise\",\"Anise helps by increasing the essential oils in herbs like basil.\",\"Thyme\",\"Thyme prefers a drier soil and doesn\\u2019t mind sandier soil conditions, whereas basil needs more moist, nutrient dense soil.\"],[\"Bergamot\",\"herb planting\",\"Oct, Nov, Dec, Jan, Feb, Mar\",\"7-21 days\",\"yellow coneflower, prairie dock, stiff goldenrod, whorled milkweed, yarrow, flowering spurge, big bluestem, Culver\'s root and turkscap lily\",\"\",\"\",\"\"],[\"Borage\",\"herb planting\",\"Sep, Nov, Dec, Jan, Feb, Jan\",\"14-21 days\",\"tomato, strawberries\",\"Borage deters tomato hornworm and cabbage moth caterpillars\",\"\",\"\"],[\"Burnet\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"14-28 days\",\"Tomato, lettuce, Basil, Chives\",\"\",\"\",\"\"],[\"Calendula\",\"herb planting\",\"Feb, Mar, Apr, May\",\"14-21 days\",\"tomatoes, asparagus\",\"Calendula attracts a wide range of pollinators because it provides nectar over the whole growing season.\",\"\",\"\"],[\"Caraway\",\"herb planting\",\"Feb, Mar, Apr, Sep, Oct, Nov\",\"10-20 days\",\"peas\",\"Caraway has long roots that can help break down and condition heavy soils\",\"fennel  dill\",\"Caraway will attract parasitic wasps and flie\"],[\"Catnip\",\"herb planting\",\"Oct, Nov, Dec, Jan, Feb, Mar\",\"7-21 days\",\"Beans\",\"Beans can benefit from catnip\\u2019s ability to repel Japanese Beetles.\",\"Parsley\",\"Parsley does not grow well with mint, and catnip is a mint plant.\"],[\"Chamomile\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"14-21 days\",\"onions\",\"Attracts hoverflies and parasitic wasps.\",\"Basil\",\"its presence increases the amount of essential oil that basil produces.\"],[\"Chervil\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"14-21 days\",\"Brassicas, lettuce, and radishes\",\"Chervil helps to repel slugs and attract parasitic wasps.\",\"\",\"\"],[\"Chives\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"14-21 days\",\"Brassicas\",\"Helps to repel aphids, carrot rust fly, and Japanese beetles.\",\"beans and peas\",\"\"],[\"Coriander\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"14-21 days\",\"tomatoes, peppers\",\"these don\'t do well alongside the nitrogen-bearing plants you may be planting by your coriander.\",\"Cosmos\",\"One good bet is to plant some tall annual flowers.\"],[\"Cress\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar, Apr, May, Jun, Jul, Aug\",\"6-12 days\",\"carrots, sunchoke, corn, sunflowers\",\"Taller plants will provide it with needed shade during summertime heat\",\"Watercress\",\"Cress is a straightforward garden plant to grow. Watercress, though, requires wet growing conditions, which may prove difficult in drought-prone areas\"],[\"Cumin\",\"herb planting\",\"Sep, Oct, Nov\",\"5-14 days\",\"Cucumbers Potatoes Cabbages Beets\",\"increase your harvest and deter pests\",\"\",\"\"],[\"Dill\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan\",\"14-21 days\",\"onion, lettuce, cabbage\",\"its ability to repel pests.\",\"tomato, carrot\",\"For various reasons this plant is incompatible with tomato and carrot.\"],[\"Echinacea\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"14-28 days\",\"Gentian phlox corepsis\",\"These perennial coneflowers attract hoverflies and parasitoid wasps, so they\'re useful for pest control in companion plantings.\",\"\",\"\"],[\"Evening Primrose\",\"herb planting\",\"Oct, Nov, Dec, Jan, Feb, Mar, Apr\",\"21-28 days\",\"narrowleaf evening-primrose\",\"It prefers well-drained soils,\",\"Perennial hollyhock\",\"The powerful roots strangled everything in the vicinity\"],[\"Fenugreek\",\"herb planting\",\"Mar, Apr, May, Jun, Jul, Aug, Sep, Oct, Nov\",\"4-14 days\",\"corn, cucumbers, and Brassicas\",\"mature fenugreek plants will begin fixing atmospheric nitrogen in the soil around the time flowering begins\",\"Onion\",\"Fenugreek can potentially host any disease common to other legumes\"],[\"Hyssop\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb\",\"5-15 days\",\"Cabbage, Grapes\",\"deterring Cabbage Moth and Flea Beatles.\",\"Radishes\",\"as they do not grow well with Hyssop.\"],[\"Lemon Balm\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"7-28 days\",\"basil, oregano, chives, tomatoes, lettuce, okra, cabbage, carrots, radishes, squashes, berries, fruit trees, cantaloupe, watermelon, marjoram, sage, thyme, parsley\",\"Like Borage this is a great plant in the garden as it draws bees for increased pollination and therefore yields.\",\"\",\"\"],[\"Lovage\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb\",\"10-20 days\",\"beans, eggplant, chilies, green peppers, peas\",\"works well as a border / edge crop, as a backdrop to the garden.\",\"Rhubarb\",\"can be attacked by fungal pathogens in very damp conditions.\"],[\"Marjoram\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"10-28 days\",\"carrots, cucumber, peppers, loofahs, pumpkins, radish, strawberries and tomatoes\",\"improve the flavour of many.\",\"\",\"\"],[\"Mint\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"7-21 days\",\"peppers, carrots, strawberries, flowers, tomatoes\",\"Careful where you plant it because it becomes invasive so it works best on the edges where you can control it. Clippings work well to repel insects and other pests. Plant with marigolds.\",\"Parsley, chamomile.\",\"\"],[\"Nasturtuim\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"14-21 days\",\"tomato and squash\",\"Nasturtium companion plants can draw such pests away from vegetable plants\",\"\",\"\"],[\"Oregano\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"10-28 days\",\" peppers, eggplant, squash, beans, cabbage, broccoli,\",\"plant it in the same kind of dry and sandy soil\",\"cruciferous vegetables\",\"void growing it around plants that have heavy water requirements\"],[\"Parsley\",\"herb planting\",\"Sep, Oct, Nov, Dec, Jan, Feb, Mar\",\"14-28 days\",\"asparagus, carrots, chives, corn, onions, and tomatoes\",\"The leaves can be sprinkled on asparagus to repel asparagus beetles, and around roses, to improve their scent.\",\"Garlic, onions, shallots,\",\"stunt the growth of parsley.\"],[\"Rosemary\",\"herb planting\",\"Sep, Oct, Nov, Mar, Apr, May\",\"14-28 days\",\"cruciferous vegetables\",\"rosemary do a very good job of attracting pollinators.\",\"cucumbers\",\"This is because they tend to release some chemicals that hinders the growth of the cucumbers.\"],[\"Rue\",\"herb planting\",\"Sep, Oct, Nov\",\"7-14 days\",\"Alpine Strawberries, Figs, Roses and Raspberries\",\"Rue acts as a natural insect repellent and protects its neighboring plants from harmful pests\",\" Basil, Sage Mint\",\"it will inhibit their growth\"],[\"Sage\",\"herb planting\",\"Sep, Oct, Nov\",\"7-21 days\",\"Brassicas Carrots  Strawberries Tomatoes Rosemary\",\"Sage can help deter pests and enhance strawberry flavor\",\"Cucumbers  Alliums Rue Wormwood Fennel\",\"it inhibits sage\\u2019s growth\"],[\"Savory\",\"herb planting\",\"Sep, Oct, Nov\",\"7-21 days\",\"beans  tomatoes\",\"make onions sweeter\",\"\",\"\"],[\"Sorrel\",\"herb planting\",\"Mar, Apr, May, Sep, Oct, Nov\",\"14-21 days\",\"sage and rosemary, starrawberry\",\"Sorrel is a hardy plant that does well with a number of other crops.\",\"beans, peas,  corn\",\"These will block out significant amounts of light, stunting the growth of the sorrel plant.\"],[\"Tarragon\",\"herb planting\",\"Sep, Oct, Nov\",\"10-28 days\",\"parsley, rosemary, sage, and lemon thyme\",\"They may fight off different pests, help the other plant, or may so well with sharing sunlight or shade\",\"\",\"\"],[\"Thyme\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"7-14 days\",\"Strawberries\",\"Thyme works as a deterrent to worms.\",\"parsley, cilantro, tarragon, basil and chives\",\"They prrefer a more moist soil,\"],[\"Wormwood\",\"herb planting\",\"Mar, Apr, May, Sep, Oct, Nov\",\"10-28 days\",\"carrots\",\"Wormwood\\u2019s natural harsh taste and strong odor tend to repel certain insect pests\",\"Plant it away from pets and child\",\"It is extremely poisonous in its raw state\"],[\"Yarrow\",\"herb planting\",\"Sep, Oct, Nov, Dec\",\"10-10 days\",\"butterfly milkweed, rudbeckia daisies\",\"it attracts pollinating bees and beneficial aphid-eating insects into garden\",\"Aster,Bee balm, Purple coneflower, Butterfly weed, Lamb\'s ear, Sedum\",\"yarrow might choke off its supply of sunlight\"]]','Copy of Copy of vegetable information.xlsx - Sheet1.csv','vegetable information.xlsx - Sheet1.csv','publish','closed','closed','','copy-of-copy-of-vegetable-information-xlsx-sheet1-csv','','','2022-04-07 13:01:58','2022-04-07 13:01:58','',0,'https://greenspacesvic.azurewebsites.net/?post_type=tablepress_table&amp;p=493',0,'tablepress_table','',0);
