INSERT INTO `wp_posts` VALUES (548,1,'2022-04-08 02:08:42','2022-04-08 02:08:42','<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"white\",\"className\":\"is-style-fill\"} /--></div>\n<!-- /wp:buttons -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Visualization plots include packed bubbles, treemap, and bar charts which are plotted using Tableau public and the vegetable information dataset and it includes information about 200 vegetables and herbs which can grow at different times of a year (specific season).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Packed bubbles for all the vegetables and herbs:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"width\":800,\"height\":600,\"linkDestination\":\"custom\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image is-resized is-style-default\"><a href=\"#\"><img src=\"https://public.tableau.com/static/images/Ve/Vegetabledatasetpackedbubbles/Sheet1/1_rss.png\" alt=\"Sheet 1 \" width=\"800\" height=\"600\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>TreeMap :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Another data visualization plot I have is the treemap which gives more detailed information about all the vegetables and herbs along with other attributes/ columns present in the vegetable information dataset such as sow direction, sow depth, germination time, etc.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":534,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1024x580.png\" alt=\"\" class=\"wp-image-534\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Bar chart:</strong> It shows three categories and eight vegetables selected as filters and they are common ones such as carrot, cabbage, broccoli, cauliflower, etc. It\'s based on Frost, tender or hardy, and days to maturity.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":538,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1.png\" alt=\"\" class=\"wp-image-538\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><object></object></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sources :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\">https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"black\",\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-black-background-color has-text-color has-background\"><strong>TP30 Green Wizards</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Vegetables Data Visualisation','','trash','closed','closed','','__trashed','','','2022-04-08 02:08:42','2022-04-08 02:08:42','',6,'https://greenspacesvic.azurewebsites.net/?page_id=548',1,'page','',0);
INSERT INTO `wp_posts` VALUES (556,1,'2022-04-08 03:10:11','2022-04-08 03:10:11','<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"white\",\"className\":\"is-style-fill\"} /--></div>\n<!-- /wp:buttons -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"full\",\"id\":344,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image alignfull size-large\"><a href=\"https://greenspacesvic.azurewebsites.net/\"><img src=\"/wp-content/uploads/2022/04/Screenshot-2022-04-07-1229-1024x54.png\" alt=\"\" class=\"wp-image-344\"/></a></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:navigation {\"ref\":619,\"textColor\":\"background\",\"backgroundColor\":\"foreground\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\"},\"style\":{\"typography\":{\"fontSize\":\"12px\"}}} /-->\n\n<!-- wp:html -->\n<p class=\"has-text-align-left\" style=\"margin-left:80px\">Visualization plots include packed bubbles, treemap, and bar charts which are plotted using Tableau public and the vegetable information dataset and it includes information about 200 vegetables and herbs which can grow at different times of a year (specific season).</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>Packed bubbles for all the vegetables and herbs:</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"width\":800,\"height\":600,\"linkDestination\":\"custom\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image is-resized is-style-default\"><a href=\"#\" style=\"margin-left:80px\"><img src=\"https://public.tableau.com/static/images/Ve/Vegetabledatasetpackedbubbles/Sheet1/1_rss.png\" alt=\"Sheet 1 \" width=\"800\" height=\"600\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>TreeMap :</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\">Another data visualization plot I have is the treemap which gives more detailed information about all the vegetables and herbs along with other attributes/ columns present in the vegetable information dataset such as sow direction, sow depth, germination time, etc.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":534,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure style=\"margin-left:80px\" class=\"wp-block-image size-large\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1024x580.png\" alt=\"\" class=\"wp-image-534\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p style=\"margin-left:80px\"><strong>Bar chart:</strong> It shows three categories and eight vegetables selected as filters and they are common ones such as carrot, cabbage, broccoli, cauliflower, etc. It\'s based on Frost, tender or hardy, and days to maturity.</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":538,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure style=\"margin-left:80px\" class=\"wp-block-image size-full\"><img src=\"/wp-content/uploads/2022/04/Sheet-1-1.png\" alt=\"\" class=\"wp-image-538\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><object></object></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"margin-left:80px\"><strong>Sources :</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p><p style=\"margin-left:80px\"><a target=\"_blank\" href=\"https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\" rel=\"noopener\">https://public.tableau.com/views/Vegetabledatasetvisualisation/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p><p style=\"margin-left:80px\"><a target=\"_blank\" href=\"https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link\" rel=\"noopener\">https://public.tableau.com/views/Vegetabledatasetvisualisationdataanalysis6/Sheet1?:language=en-US&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p><p style=\"margin-left:80px\"><a target=\"_blank\" href=\"https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link\" rel=\"noopener\">https://public.tableau.com/views/Vegetabledatasetpackedbubbles/Sheet1?:language=en-US&amp;publish=yes&amp;:display_count=n&amp;:origin=viz_share_link</a></p></p>\n<!-- /wp:html -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"full\",\"id\":338,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignfull size-full\"><img src=\"/wp-content/uploads/2022/04/Screenshot-2022-04-07-123330.png\" alt=\"\" class=\"wp-image-338\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','Vegetables Data Visualisation','','publish','closed','closed','','vegetables-data-visualisation-2','','','2022-04-08 03:10:11','2022-04-08 03:10:11','',6,'https://greenspacesvic.azurewebsites.net/?page_id=556',1,'page','',0);
